<body>
Сообщает о сравнении выражения <code>typeof</code> со строковым литералом, который не является одним из стандартных типов: <code>undefined</code>, <code>object</code>, <code>boolean</code>, <code>number</code>, <code>string</code>, <code>function</code> или <code>symbol</code>.
Такие сравнения всегда возвращают <code>false</code>.
